listing_jobDesc:
Contexte
Nous recherchons plusieurs Développeurs PHP/ Symfony (H/F).

Projet
Intégré(e) au sein d’une équipe projet, vous contribuez à la construction et l’évolution de la partie back end des différentes applications que nous réalisons (secteur médias, e-commerce, des jeux ).

Poste et missions

Dans le cadre de vos missions, vous :

Concevez et réalisez les développements sous PHP 7/ 8 Symfony 4 et 5 ;
Participez à l’évolution de l’architecture hexagonale ou microservices;
Ecrivez les tests automatisés unitaires (PHPUnit) et de non-régression ;
Assurez la rédaction de documentations techniques ;
Participez à la résolution des problématiques de performances et de montées en charge ;
Travaillez en méthodologie Agile.

Environnement Technique : PHP 7/8, Symfony 4/5, architecture hexagonale, API Platform, RabbitMQ, MySQL, Git, CI/CD.

Profil
De formation Bac +2 à Bac +5,

Vous avez une très bonne maitrise de PHP 7 et 8 et MySQL ;
Vous maitrisez Symfony 4 et 5, Javascript, Git et docker ;
Vous avez travaillé avec des problématiques de cache et de performance (utilisation de varnish, redis etc) ;
Vous avez une passion pour le développement et les challenges algorithmiques.

