Dans le cadre d’un projet chez l’un de nos clients grands comptes, nous sommes à la recherche d’un Développeur Windev/Webdev.

Sous l’autorité du responsable du département des systèmes d’informations, vous assurerez la maintenance et l’évolution des applications métiers, Développement d’applications métiers et de fonctionnalités nouvelles avec les outils PCSOFT (WINDEV, WEBDEV et HFSQL).

Vous aurez pour missions :
Administration et maintenance des applications métiers (intranet, extranet, sites internet, applications et services windows).
Analyse des besoins utilisateur et formalisation de cahiers des charges fonctionnels et techniques ;
Surveillance quotidienne du bon fonctionnement des applications. Correction des dysfonctionnements signalés ;
Appui aux utilisateurs et formation des nouveaux arrivants aux outils intranet ;
Rédaction et mise à jour périodiques des manuels d’utilisation ;
Migration annuelle des applications vers la dernière version des produits PCSOFT en relation avec le responsable des systèmes d’informations.

De formation supérieure (Ecole d’ingénieur, master, second cycle universitaire), vous justifiez d’une expérience d’au moins 5 ans dont 2 ans sur les outils PCSOFT (WINDEV et WEBDEV). Passionné par le développement d’applications, vous êtes rigoureux et organisé, et vous êtes capable de travailler en équipe dans un environnement multiculturel.

Maîtrise des fonctions avancées de WINDEV / WEBDEV telles que la programmation orientée objet, la gestion des threads, la communication par sockets ou le développement d’API. Réalisation de sites internet en mode AWP ;
Maitrise du langage SQL ;
Pratique du SGBD HFSQL ;
Administration de sites intranet et internet via le serveur d’application WEBDEV. Dans le cadre d’un projet chez l’un de nos clients grands comptes, nous sommes à la recherche d’un Développeur Windev/Webdev.

