Les missions attribuées seront les suivantes :

Conception et réalisation des éléments de chartes graphiques ;
Développement sur les technologies React / N ;
Développement des interfaces avec les Web Services et les échanges inter applicatifs ;
Développement et mise au point des HTML 5, CSS 3 ;
Respect des bonnes pratiques du développement conformément à l'approche clean code ;
Réalisation des tests unitaires / Tests d'intégration.

Stack technique :

Maîtrise de React ou Angular
Maîtrise de NodeJS
Connaissances de TypeScript
API REST
Connaissances de Jenkins et Docker
Mindset Agile Scrum

